import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);

const defaultImage = 'data:image/jpeg;base64,';
const store = new Vuex.Store({
  state: {
    cardType: 'minion',
    profession: 'neutral',
    quality: 'classical',
    cardName: '',
    description: '',
    phyle: '',
    mana: 0,
    attack: 0,
    health: 0,
    golden: false,
    mainImage: defaultImage,
  },
  getters: {
    backgroundImage: state => require(`../assets/background/${state.profession}-${state.cardType}.png`),
    manaCostImage: state => require(`../assets/property/cost/${state.mana}.png`),
    attackImage: state => require(`../assets/property/attack/${state.attack}-${state.cardType}.png`),
    healthImage: state => require(`../assets/property/health/${state.health}-${state.cardType}.png`),
    qualityImage: state => require(`../assets/quality/${state.quality}-${state.cardType}.png`),
    dragonImage: state => require(`../assets/dragon/${state.cardType}-dragon.png`),
  },
  mutations: {
    changeCardType(state, payload) {
      state.cardType = payload.cardType;
    },
    changeCardName(state, payload) {
      state.cardName = payload.cardName;
    },
    changeProfession(state, payload) {
      state.profession = payload.profession;
    },
    changeDescription(state, payload) {
      state.description = payload.description;
    },
    changeQuality(state, payload) {
      state.quality = payload.quality;
    },
    changePhyle(state, payload) {
      state.phyle = payload.phyle;
    },
    changeMana(state, payload) {
      state.mana = payload.mana;
    },
    changeAttack(state, payload) {
      state.attack = payload.attack;
    },
    changeHealth(state, payload) {
      state.health = payload.health;
    },
    changeDamage(state, payload) {
      state.damage = payload.damage;
    },
    changeDurability(state, payload) {
      state.durability = payload.durability;
    },
    changeGolden(state, payload) {
      state.golden = payload.golden;
    },
    changeMainImage(state, payload) {
      state.mainImage = payload.mainImage;
    },
  },
});

export default store;
